import React from "react"
import { Layout,Affix } from "antd"
function Header(){
    return (
        <Affix 
        offsetTop={0}
        >
            <Layout.Header>
                <div className="wrap"> 

                <Row>
                    <Col span={4} />
                    <Col  span={20}/>
                </Row>

                </div>
            </Layout.Header>
        </Affix>
    )
}
export default Header;
